import styles from './MealItem.module.css';

const MealItem = (props) => {
    return (
        <li className={styles.meal}>
            <div>
                <h3>{props.name}</h3>
                <p className={styles.description}><i>{props.description}</i></p>
            <p className={styles.price}>${props.price}</p>
            </div>
            <div></div>

        </li>
    );
};

export default MealItem;
